import React,{useState} from "react";

export const FullGradde = () =>{
    const [show,setShow] = useState(false);

    if(!show){
        return(
            <section>
                <div class="container grade" onClick={()=>setShow(true)}>
            
                    <h1 class="title" style={{cursor:'pointer'}} >Общщая Оценка</h1>
                    <h1>&#8744;</h1>
                </div>
            </section>
        )
    }else{
        return(
            <section>
                <div class="container" style={{backgroud:'#000'}}>
            
                <div class="container grade" onClick={()=>setShow(false)}>
            
                    <h1 class="title" style={{cursor:'pointer'}} >Общщая Оценка</h1>
                    <h1>&#8743;</h1>
                </div>
                    <div class='inside-container'>
                        Полный подсчет всех пунктов
                    </div>
            
                </div>
            </section>
        )
    }
    
}
